    let announcementElements =
        props.announcements.map((p, idx)=><div>
                <div>{p.title}</div>
                <div>{p.description}</div>


            </div>
           /* <PostAnnoun    title={p.title} description={p.description} key={idx}/>*/
        );
    const today = new Date();
    /*let announcementElements =
        props.announcements;*/

    return (
        <div>
            <h1>Sign Up</h1>
            <Formik
                initialValues={{
                    title: '',
                    description: '',
                }}

                onSubmit={(values) => {
                    props.setAnnouncement(values);
                }}
            >
                <Form>
                    <label htmlFor="title"> title </label>
                    <Field id="title" name="title" placeholder="Enter text"/>

                    <label htmlFor="description">Description</label>
                    <Field id="description" name="description" placeholder="Enter text"/>


                    <button  type="submit">Submit</button>
                </Form>
            </Formik>
            {/*<div>
                <b>result announcement:</b> {props.title}
            </div>*/}
            {/*<div>
                <b> Full name </b>: {props.announcement.title}
            </div>*/}
            <div>
                {announcementElements}
            </div>
            {/*<div>
                <b>result description:</b>
            </div>*/}
        </div>);
};
export default Announcement;
